Storyline:


     A gang of gunrunners is sought by both the Mexican Federales and the Yaqui Indians - by the federal police to prevent the marauding Indians from preying on innocent farmers and by the Yaqui because the gunrunners' leader sold them bad medicine resulting in blindness for many of their children. The Federales capture the criminals, but both parties are surrounded in a ruined mission by the angry Indians. Can the Federales and gunrunners work together to survive the onslaught of the Yaqui?




